Ad. I know I can’t be the only one who makes a mental note to put things on my shopping list while cooking but then always seems to forget to actually write it down 🤦🏾‍♀️

My new @amazonuk Echo Show 10 has been such a great help in the kitchen, especially when I’m baking. The screen moves with me and I can simply ask Alexa to set all my different timers and add ingredients to my list as I go. Love! 
@alexa99 #AskAlexa
